import React, { Component } from 'react'

export class Selection extends Component {
    constructor(props) {
        super(props)
        this.state = {
             selection: [
                {
                    key: 'All products',
                    name: 'Товары'
                },
                {
                    key: "phones",
                    name: "Смартфоны"
                },
                {
                    key: "tablets",
                    name: "Планшеты"
                },
                {
                    key: "laptop",
                    name: "Компьютеры"
                },
                {
                    key: "watches",
                    name: "Часы"
                }
             ]
        }
    }
  render() {
    return (
      <div className='selection'>
        {this.state.selection.map(obj => (
            <div key={obj.key} onClick={() => this.props.selectCategory(obj.key)}>{obj.name}</div>
        ))}
      </div>
    )
  }
}

export default Selection
